--------------------------------------------------------------------------------------------------------------------------------
-- insert new parameters to specific terminals
--------------------------------------------------------------------------------------------------------------------------------
declare @tid varchar(15)
declare @FromModel varchar(20)
declare @FromAppnm varchar(10)

--SET @FromModel='Vx-675'
SET @FromModel='Vx-520'
SET @FromAppnm='EPOS01A4P'

declare merch_cursor cursor for

select DISTINCT TERMID from vc30.relation
where famnm = @FromModel and appnm = @FromAppnm
and CLUSTERID = 'PIRAEUS'
--and TERMID <> '99000002'
and TERMID in
('73003092')
--and TERMID not in ('520CHAL')

open merch_cursor
if @@ERROR > 0
  return

fetch next from merch_cursor
into @tid

while @@FETCH_STATUS = 0
begin
--  delete from vc30.PARAMETER where PARTID = @tid

        insert into vc30.PARAMETER
        (FAMNM, APPNM, PARTID, PARNAMELOC, SEQINFO, DLDTYPE,PARINFO, VALUE,PSIZE,FLAG)
        (
        select @FromModel,@FromAppnm, @TID, PARNAMELOC, seqinfo = (select  max(seqinfo) + 1 from vc30.PARAMETER where PARTID = @TID), DLDTYPE,PARINFO, VALUE,PSIZE,FLAG
        from vc30.parameter where
        PARTID = '73000010' and PARNAMELOC = 'CONTACTLESS' and FAMNM = @FromModel and APPNM = @FromAppnm
        )
--                                        PARNAMELOC      seqinfo DLDTYPE PARINFO VALUE   PSIZE   FLAG
--Vx-520  EPOS01A4P       73003092        CONTACTLESS     248     FP              TRUE            P

  fetch next from merch_cursor
  into @tid
end

CLOSE merch_cursor
deallocate merch_cursor

